import React from "react";

const ExpenseItem = ({ expenses }) => {
  console.log(expenses[0].price);
  return (
    <div className="ExpenseItem">
      {expenses.map((item) => (
        <div>
          {item.name}
          {item.price}
        </div>
      ))}
    </div>
  );
};

export default ExpenseItem;
